import React from "react";
import VideoBgSection from "../Components/videoBgSection.jsx";
import SectionWithImg from "../Components/sectionWithImage.jsx";

function AboutUs() {
  return (
    <React.Fragment>
      <VideoBgSection />
      <SectionWithImg
        heading="About Us"
        text="Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum."
      />
      <div className="d-flex">
        <SectionWithImg
          heading="Mission"
          text={`<p>Our mission is to provide our customers with unparalleled experience by making the best product. To create wealth for all our stakeholders by building highly successful business based on a customer approach and contribute to the community.</p><p>We are here for our clients make distinctive, lasting, and substantial improvements in their performance and to build a great firm that attracts, develops excites and retains exceptional people.We believe we will be successful if our clients are successful.</p>`}
        />
        <SectionWithImg
          heading="Vision"
          text="Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum."
        />
      </div>
    </React.Fragment>
  );
}

export default AboutUs;
